import React from 'react'
import { Input} from 'semantic-ui-react'
import SwiperSlider from '../SwiperSlider'
const Home = () => {
    return (
      <div
        className="valueProposition"
        style={{ backgroundImage: "url(/house.jpg)" }}
      >

        <div>
          <Input action={{ icon: "search" }} placeholder="Search..." />
        </div>
      </div>
    );
}

export default Home
